class Producto extends Component {
    state = {  }
    render() { 
        const {producto} = this.props;
        console.log(producto);
        return ( 
            <Fragment>
                <td>{producto.nombre}</td>
                <td>$ {producto.precio}</td>
                <td>{producto.stock}</td>
            </Fragment>
            
         );
    }
}
 
